"use strict";
const InputNode = require("../core/InputNode.js");
const THREE = require("three");
class Matrix3Node extends InputNode {
  constructor(value = new THREE.Matrix3()) {
    super("mat3");
    this.value = value;
    Object.defineProperty(this, "isMatrix3Node", { value: true });
  }
}
module.exports = Matrix3Node;
